import Image from '../../Assets/logo.png'
import styles from './MainSite.module.css'

function MainSite() {
    return(
        <div className={styles.container}>
            <div>
            <img src={Image} alt='Logo of Ot'/>
            <span>OT-Gropue</span>
            </div>
        </div>
    )
}

export default MainSite;
